  `quote_date` int(11) DEFAULT NULL COMMENT '报价日期',
  `remark` tinytext COMMENT '备注',
  `winbid_date` int(11) DEFAULT NULL COMMENT '中标时间',
  `quote_endtime` int(11) DEFAULT NULL COMMENT '报价截止日期',
  `price_num` int(11) DEFAULT NULL COMMENT '计价数量',
  `price_uom` varchar(32) DEFAULT NULL COMMENT '计价单位',
  `tc_num` int(11) DEFAULT '1' COMMENT '交易数量',
