  `read_at` int(11) DEFAULT NULL COMMENT '供应商阅读时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uni_code` (`pr_code`,`item_code`,`sup_code`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1000 DEFAULT CHARSET=utf8 COMMENT='询价单表';

