CREATE TABLE `atw_po` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'id',
  `order_code` varchar(32) DEFAULT NULL COMMENT '订单号',
  `pr_code` varchar(32) DEFAULT NULL COMMENT '请购订单号',
  `pr_ln` varchar(32) DEFAULT NULL COMMENT '请购订单行号',
  `doc_type` varchar(8) DEFAULT 'PO01' COMMENT '单据类型 U9参数  PO01',
  `doc_date` int(11) DEFAULT NULL COMMENT '单价日期',
  `sup_code` varchar(32) DEFAULT NULL COMMENT '供应商代码',
  `tc_code` varchar(8) DEFAULT NULL COMMENT '币种编码  C001:人民币',
  `biz_type` varchar(16) DEFAULT '316' COMMENT 'U9参数 固定值：316',
  `is_include_tax` tinyint(1) DEFAULT '1' COMMENT '是否含税',
  `is_sup_read` tinyint(4) DEFAULT NULL COMMENT '供应商是否阅读',
  `contract` text COMMENT '合同映象',
  `contract_time` int(11) DEFAULT NULL COMMENT '签订合同时间',
  `status` varchar(16) DEFAULT 'init' COMMENT '状态  \r\ninit=初始\r\nsup_cancel=供应商取消 \r\nsup_edit=供应商修改 \r\natw_sure=安特威确定\r\nsup_sure = 供应商确定/待上传合同\r\nupload_contract = 供应商已经上传合同contract_pass  = 合同审核通过\r\ncontract_refuse= 合同审核拒绝\r\nexecuting  = 执行中\r\nfinish=结束',
  `remark` varchar(64) DEFAULT NULL COMMENT '合同审核备注/拒绝原因',
  `create_at` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_at` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  `read_at` int(11) DEFAULT NULL COMMENT '阅读时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1000 DEFAULT CHARSET=utf8 COMMENT='采购订单表';

