-- ----------------------------
--  Table structure for `atw_u9_pr`
-- ----------------------------
DROP TABLE IF EXISTS `atw_u9_pr`;
CREATE TABLE `atw_u9_pr` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pr_code` varchar(100) NOT NULL COMMENT '请购单号',
  `pr_ln` int(11) DEFAULT NULL COMMENT '请购单行号',
  `item_code` varchar(100) NOT NULL DEFAULT '' COMMENT '料号',
  `item_name` varchar(100) DEFAULT NULL COMMENT '料品',
  `item_desc` tinytext COMMENT '物料描述',
  `pro_no` varchar(50) DEFAULT NULL COMMENT '项目号',
  `tc_num` int(11) DEFAULT '1' COMMENT '交易数量',
  `tc_uom` varchar(8) DEFAULT '' COMMENT '交易单位',
  `price_num` int(11) DEFAULT NULL COMMENT '计价数量',
  `price_uom` varchar(8) DEFAULT '' COMMENT '计价单位',
  `req_date` int(11) DEFAULT NULL COMMENT '需求日期',
  `pr_date` int(11) DEFAULT '0' COMMENT '请购日期',
  `u9_status` varchar(32) DEFAULT NULL COMMENT 'u9状态',
  `status` varchar(32) DEFAULT 'init' COMMENT '状态\r\ninit=初始\r\nhang=挂起\r\ninquiry=询价中\r\nflow = 流标\r\nclose = 关闭',
  `inquiry_way` varchar(10) CHARACTER SET latin1 DEFAULT NULL COMMENT '询价方式  \r\nassign = 指定供应商 \r\nexclusive=独家采购\r\ncompete=充分竞争',
  `create_at` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_at` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  `is_appoint_sup` tinyint(4) unsigned DEFAULT '0' COMMENT '是否指定供应商',
  `appoint_sup_code` varchar(64) DEFAULT NULL COMMENT '指定供应商的编码',
  `appoint_sup_name` varchar(64) DEFAULT NULL COMMENT '指定供应商名称',
  `tax_rate` float(3,2) DEFAULT '0.17' COMMENT '税率',
  `check_status` varchar(16) DEFAULT NULL COMMENT '主管审批 agree同意 refuse拒绝',
  `quote_endtime` int(11) DEFAULT NULL COMMENT '报价截止日期',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uni_pr_item` (`pr_code`,`item_code`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1000 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `atw_u9_sup_item`
-- ----------------------------
