  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `code` varchar(32) DEFAULT NULL COMMENT '供应商编号',
  `name` varchar(32) DEFAULT NULL COMMENT '供应商名称',
  `type_code` varchar(16) DEFAULT NULL COMMENT '主分类编码',
  `type_name` varchar(16) DEFAULT NULL COMMENT '主分类名称',
  `state_tax_code` varchar(32) DEFAULT NULL COMMENT '地税号',
  `national_tax_code` varchar(32) DEFAULT NULL COMMENT '国税号',
  `found_date` int(11) DEFAULT NULL COMMENT '成立日期',
  `tax_rate` float(3,2) unsigned DEFAULT '0.00' COMMENT '税率',
  `mobile` varchar(64) DEFAULT NULL COMMENT '电话',
  `phone` varchar(64) DEFAULT NULL COMMENT '电话',
  `email` varchar(64) DEFAULT NULL COMMENT '邮箱',
  `fax` varchar(32) DEFAULT NULL COMMENT '传真',
  `ctc_name` varchar(32) DEFAULT NULL COMMENT '联系人',
  `address` varchar(255) DEFAULT NULL COMMENT '地址',
  `pay_way` varchar(255) DEFAULT NULL COMMENT '付款方式',
  `com_name` varchar(32) DEFAULT NULL COMMENT '企业名称',
  `purch_code` varchar(32) DEFAULT NULL COMMENT '采购员工号',
  `purch_name` varchar(32) DEFAULT NULL COMMENT '采购员工姓名',
  `purch_type` varchar(16) DEFAULT NULL COMMENT '供应商采购属性',
  `check_type` varchar(16) DEFAULT NULL COMMENT '检验类型',
  `check_rate` float(3,2) DEFAULT NULL COMMENT '抽检比例',
  `create_at` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_at` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uni_code` (`code`)
) ENGINE=InnoDB AUTO_INCREMENT=1000 DEFAULT CHARSET=utf8;

